descriptions:
{'es-ES': 'Casa con jardín de 120 metros cuadrados en su parte trasera, situada a 1 kilómetro del centro de verín (ourense).

casa totalmente equipada para entrar a vivir, con 2 cocinas y gran terraza. se distribuye en, planta baja con amplio garaje, salón-cocina con salida a jardín privado totalmente cerrado, baño, bodega y cuarto de calderas de gasóleo. en la primera planta dispone de 3 dormitorios, otra cocina con salida a la terraza, de la cual se accede al terreno, salón con galería, y 2 baños, uno de ellos en el dormitorio principal. el bajo cubierta actualmente sin preparar, como trastero.

la casa dispone de calefacción y agua caliente de gasóleo, con termo de agua caliente para el verano no tener que encender la caldera. se vende completamente amueblada.'}

{'es-ES': 'Apartamento en venta en Rúa Río Arnoia en Ourense ciudad. Muy cerca de la estación intermodal de Ourense. Zona con todos los servicios.

El inmueble cuenta con 74m². Estos se distribuyen en: amplia cocina independiente con comedor, salón, 2 habitaciones, 1 baño y galería. Se encuentra en perfectas condiciones, listo para entrar a vivir en él. La cocina está totalmente amueblada y equipada. Cuenta con vistas despejadas a la estación de tren de la ciudad. En cuanto a su calefacción es eléctrica. Incluye amplio trastero de 8m².

Se encuentra en una tercera planta. El próximo mes empieza la construcción del ascensor del edificio.'}

{'es-ES': 'GESPROMAR VENDE casa céntrica amueblada de 564 m² en Castro Caldelas, en plena Ribeira Sacra (Ourense). La casa se divide en dos amplias y luminosas plantas, que cuentan con tres dormitorios, dos baños completos, un comedor con chimenea, dos salas de estar, una galería, una cocina equipada una terraza y armarios empotrados. En la planta baja nos encontramos un gran garaje a pie de calle. Con bastantes posibilidades como inversión o para una familia....

No dudes en llamarnos y venir a verla!

Pedir más información'}

{'es-ES': 'Piso situado en Allariz villa que cuenta con todos los servicios necesarios (colegios, supermercados, zonas verdes, etc) destacando por su belleza y ambiente familiar.

La vivienda posee 118m2 útiles. El piso está distribuido en gran salón-comedor, cocina independiente amueblada, 3 habitaciones y 2 baños, uno de ellos en el dormitorio principal.Exterior y  muy soleado. Tiene una terraza en la cocina y  gran terraza cerrada tipo galería en la parte posterior (con zona de lavadero).  Tiene trastero de 30m2 justo encima de la vivienda, por lo que se podría unir para hacer un dúplex. Cuenta con garaje  privado cerrado y huerto de 150m2. 

Es una segunda planta sin ascensor, pero con espacio para su colocación.'}

{'es-ES': 'Piso para reformar en venta en Rúa Verea Vella, en la zona de A Ponte. Cerca del Parque del Puente y la Estación. Con todos los servicios. 

El inmueble cuenta con 100m². Estos se distribuyen en: salón-comedor, cocina independiente, 4 dormitorios, 1 baño, 1 aseo y balcón. Perfecto para reformar y sacarle el máximo partido. Es exterior y luminoso. En cuanto a su agua caliente es de butano. 

El precio de la comunidad es de 25€/mes.'}

{'es-ES': 'Estupendo piso para reformar en la Plaza de la Marina de la Avenida de Santiago del Vinteun. Zona muy demandada, con muy buena conexión con el barrio de A Ponte y el centro.

El inmueble cuenta con 109m². Está totalmente para reformar. Cuenta con salón, cocina independiente, 4 habitaciones y 1 baño. Además cuenta con una amplia terraza y balcón. En cuanto a sus suelos, son de terrazo. Es exterior y luminoso.

Ideal para reformar y dejar a tu gusto.'}

{'es-ES': 'Gran Oportunidad. Casa Amueblada en Venta en San Cibrao das Viñas, a 12 minutos de Ourense ciudad. Zona con todos los servicios y buen acceso (tanto desde el Piñeiral como de la salida de Rante). 

La casa tiene una superficie construida de 290m2 y consta de dos plantas. En la planta baja nos encontramos: bodega, pozo de agua, garaje cerrado y gran comedor con chimenea francesa. En la planta superior hay dos espacios separados: en uno está la cocina totalmente amueblada con aseo y galería cerrada, comedor amplio y 1 dormitorio; en el otro espacio están un salón con galería, 3 dormitorios y 1 baño. La casa se vende totalmente amueblada. Su calefacción es de gasóleo con depósito de 1000l.

No tiene terreno.'}

{'es-ES': 'GESPROMAR VENDE Casa rústica de 350 m² y parcela de 4595 m² en zona de Poboeiros, Castro Caldelas (Ourense). La casa se divide en dos plantas que cuentan con cuatro dormitorios, un baño completo, un comedor, una sala de estar, una cocina amueblada con cocina de leña, una pequeña galería, una terraza y un horno de leña en una construcción contigua  a la casa. En la zona exterior encontramos una zona de huerta, patio, jardín, una cuadra para vacas, un  garaje amplio, una bodega y una amplia extensión de terreno rústico. 

Es una casa con amplias posibilidades, incluso para alquiler turístico. No dudes en llamarnos y venir a verla!

Pedir más información'}

{'es-ES': 'Casa en venta en Sandiás, concello muy cercano a Xinzo de Limia (a 5km) y a media hora de Ourense. Zona muy tranquila, con diversas viviendas rehabilitadas. Cuenta con buena comunicación a la Nacional y autovía A52. 

La casa principal tiene 166m² en dos plantas para actualizar, aunque también sirve para entrar a vivir. En planta baja encontramos amplia cocina y salón con chimenea. En la primera planta se encuentran las 3 habitaciones y 1 baño. Tiene una casa adosada en piedra de 90m² para reformar, con escalera de piedra exterior y escalera interior comunicando con la casa principal. Cuenta con pozo de agua propio.

En la parte trasera, al fondo del terreno posee otra edificación de planta baja de 46m² para reformar en su interior.'}

{'es-ES': 'Preciosa casa rural totalmente rehabilitada en Pereiro de Aguiar, a 5 minutos de Ourense. Zona con muy buena comunicación y buen acceso, ambiente familiar y tranquilo.

La casa cuenta con 180m² en dos plantas. En la planta baja encontramos garaje y trastero. En la planta alta encontramos un amplio salón-comedor con cocina del tipo americana con cocina de leña, otro salón con galería, 2 habitaciones y 1 baño. Está totalmente reformada, con gran gusto y totalmente amueblada. Está totalmente a estrenar, con primeras calidades. Destaca la luminosidad de la vivienda, teniendo casi todas las estancias luz cenital que entra por las ventanas situadas en el techo. 

Cuenta con pozo de agua con motor a estrenar. A unos metros de la casa tiene un pequeño almacén y un terreno para huerta de 71 m².'}

{'es-ES': 'Casa para rehabilitar en Taboadela, cerca de Ourense ciudad. Se encuentra bien comunicada con la Nacional 525 y con el centro del concello.

La casa cuenta con 146m² construidos en dos plantas. La planta baja de 68m² está destinada a almacén y bodega. Mientras, en la planta de arriba de 72m² está el salón, la cocina, 3 habitaciones, 1 baño y galería cerrada. 

Cuenta con un terreno trasero de 407m².Tiene un alpendre adosado.'}

{'es-ES': 'Estupenda casa en venta en Rúa Camino Castela. Se encuentra muy cerca de la zona de San Francisco, zona del auditorio y de la Residencia.

La casa cuenta con 122m². Estos se distribuyen en: comedor, cocina independiente, salón, 2 dormitorios y 1 baño. Su cocina se encuentra totalmente amueblada y equipada. Cuenta con un estupendo balcón en una de sus habitaciones. Tiene armarios empotrados y sus suelos son de madera. En cuanto a su calefacción es de leña y el agua caliente es de gas. 

Cuenta con un terreno de 30m².'}

{'es-ES': 'Casa en Venta en Taboadela, a 17 minutos de Ourense ciudad. Zona con todos los servicios y con muy buena conexión con Ourense ciudad.

El inmueble cuenta con 231m² construidos. En la planta baja encontramos: 2 garajes amplios,  cocina con chimenea, baño y trastero. Si subimos en la planta superior encontramos: salón-comedor, cocina independiente, despensa, 3 habitaciones, baño y amplia terraza. Cuenta con armarios empotrados y suelos de gres. 

Se encuentra en una parcela de 1400m² en perfecto estado. Tiene pozo de agua, árboles frutales, pinos, robles, etc.'}

{'es-ES': 'Casa en venta en la zona del Vinteún en Ourense ciudad. Zona tranquila, con zonas verdes y a un paso del centro de la ciudad. Buena conexión de autobús urbano.

La casa cuenta con 378m² construidos, quedando 350m² útiles distribuidos en 3 plantas. Cuenta con un sótano diáfano con almacén y leñera. En la planta baja posee hall de entrada, cocina independiente, salón-comedor con chimenea, 2 habitaciones y 2 baños. Su cocina se encuentra totalmente amueblada y equipada. Si subimos, en la primera planta encontramos las otras 4 habitaciones y 2 baños. Tiene un balcón y una amplia terraza con preciosas vistas. 

Tiene calefacción. Cuenta con garaje y jardín.'}

{'es-ES': 'SE VENDE ESTUDIO SEMINUEVO CON GARAJE PARA MOTO EN BARROCANES IDEAL PARA INVERSORES. REF:5943

 La propiedad se encuentra localizada en la zona nueva de Barrocanes, emplazada en un edificio construido en 2007, completamente adaptado a personas con movilidad reducida. Distribuye sus 45 m2 útiles en una habitación con armario empotrado, un cuarto de baño completo, un salón comedor con cocina americana completamente equipada. Rematada con suelos de tarima y ventanas de aluminio climalit disfruta a mayores de una plaza de garaje para moto en el mismo edificio, una bodega de 4 m2, calefacción y agua caliente por gas-ciudad, dos ascensores, videportero, orientación Este y puerta blindada.

 La vivienda cuenta con un estado de conservación calificable como nuevo, huecos cómodos al estar distribuida sin utilizar pasillo y muy fresca en verano gracias a su orientación. La plaza de garaje está al lado del ascensor. La cuota de la comunidad es de 25 €/mes'}

{'es-ES': 'Piso de tres dormitorios y dos cuartos de baño. Se encuentra en la segunda planta de un edificio plurifamiliar, situado en el municipio e O Carballiño, provincia de Ourense. 

La vivienda se encuentra distribuida en salón-comedor, cocina, tres dormitorios, dos baños y un balcón, con una superficie útil de 90,62 m2. Tiene como anejos una plaza de garaje de 13,84 m2 y un trastero de 3,23 m2, ambos situados en la planta sótano del edificio. 

Dispone de buena comunicación con la carretera N-541 y con la OU-208.'}

{'es-ES': 'Casa para reformar en Moces, perteneciente al concello de Melón. Se encuentra a 5 minutos andando de las Pozas de Melón. Zona con precioso paisaje natural, cerca de Ribadavia. 

Nos encontramos ante 607m² de parcela urbanizable. Esta cuenta con diversas edificaciones: casa, bodega, hórreo, lareira... Perfecta para reformar y dejar a tu gusto. 

El precio es negociable.'}

{'es-ES': 'Pio de dos dormitorios y dos cuartos de baño. Se encuentra en la planta bajocubierta de un edificio plurifamiliar, situado en el municipio de O Carballiño, provincia de Ourense. 

La vivienda dispone de 61,73 m2 de superficie útil y se distribuye en salón-comedor, cocina, dos dormitorios, dos baños y tendedero. Tiene como anejos una plaza de garaje de 18,23 m2 útiles y un trastero de 4,50 m2 de superficie útil, ambos en la planta sótano del edificio. 

Dispone de buena comunicación con la carretera N-541 y con la OU-208.'}

{'es-ES': 'Casa adosada en piedra, ubicada unos 20 km. de Verín. Distribuida en 2 planas, en la planta baja disponemos de zona de lavandería, baño y almacenes, en dicho espacio es ideal como aprovechamiento para aumentar la superficie del espacio destinado a vivienda.

En la planta superior disponemos de una sala que da paso a 2 dormitorios y una cocina amueblada, con chimenea.

Tiene la opción de comprar como anexo una amplia casa de piedra para restaurar ubicada justo en frente de esta vivienda.'}

{'es-ES': 'VENTA PISO VEINTIUNO

Piso corrido, totalmente exterior, se distribuye en 3 habitaciones, salón, amplia cocina con acceso a balcón, 1 baño completo, 1 aseo, 1º sin ascensor. 2 balcones. Suelos de terrazo, necesita reforma. El edificio cuenta con toma de gas natural.


Para más información visite nuestra oficina en C/ Valle Inclán nº3, galerías Santo Domingo o llámenos al 988 241 993.'}

{'es-ES': 'Precioso Chalet situado en la Recta de Vilar, a 8 minutos de Ourense centro Ciudad. A 3 minutos andando de la casa se encuentra la parada de autobús urbano de Ourense, con conexión con la línea 13 (Palmés-Residencia), que pasa cada hora. 

La casa cuenta con 250m2, en una parcela de 2000m2. La vivienda tiene 2 plantas en las que encontramos: un amplio salón-comedor con chimenea, cocina totalmente equipada, 4 habitaciones, 2 baños, 1 aseo, amplia terraza haciendo esquina en la planta superior y garaje. Goza de una buena distribución, siendo todas las estancias amplias, cómodas y luminosas. Cuenta con primeras calidades en materiales y acabados, además de estar totalmente amueblada. Su garaje es amplio, con espacio para dos vehículos.

La parcela está totalmente cerrada y acondicionada. Cuenta con zona de barbacoa y pequeña caseta secundaria en la que guardar material, herramientas, etc. También cuenta con pozo y sistema de riego automático.'}

{'es-ES': 'Ubicado en la localidad de Rubia, en Orense, se encuentra esta vivienda, localizado en la planta de altura media.

El edificio en el que se encuentra data del año 1951, teniendo asi una antigüedad de 68 años. 
#ref:7051900'}

{'es-ES': 'Piso con Jardín en Rúa Julia Minguillón, en la zona del Couto. A 5 minutos del centro de la ciudad, cuenta con todos los servicios necesarios (supermercados, colegios, conexión con autobús urbano, etc). 

Precioso inmueble de 80m2. Estos se distribuyen en: salón-comedor, cocina independiente, 3 habitaciones, 1 baño y zona de lavadero. Además cuenta con jardín privado que rodea todo el piso. Se vende amueblado, cuenta con primeras calidades: suelos en perfecto estado, cocina totalmente equipada, preciosa decoración minimalista, etc.

Se contempla la posibilidad de ALQUILER CON OPCIÓN A COMPRA. Este tendría una entrada de 15.000€ y un alquiler de 500€/mes durante 3 años.'}

{'es-ES': 'Piso amplio y luminoso en zona residencia. barrio tranquilo con todos los servicios y muy bien comunicado.
Tres dormitorios, baño, aseo, salon hacia la calle y cocina independiente.

informese en nuestra oficina, Nuestra señora de la sainza, Nº42, bajo'}

{'es-ES': 'Preciosa casa en venta en Barra de miño, perteneciente al Concello de Coles. Se encuentra a menos de 10km de Ourense ciudad. Zona con muy buena conexión, familiar y tranquila. 

La casa cuenta con 350m² distribuidos en 3 plantas. En la planta semi sótano (150m²) encontramos un amplio garaje con capacidad para 4 coches. En la primera planta (150m²) posee: salón-comedor con chimenea, cocina independiente totalmente amueblada y equipada, 5 dormitorios y 1 baño. Y una planta bajo-cubierta (100m²) que se puede preparar para posible vivienda. Cuenta con dos grandes balconadas, una en la parte delatera de la casa y otra en al trasera. Tiene preciosas vistas despejadas a la montaña.

Se encuentra en una parcela de 800m². Está totalmente cerrada, tiene fosa séptica, agua de la traída y pozo.'}

{'es-ES': 'VENTA CASA SITUADA EN CALVOS-PEREIRO DE AGUIAR

Casa unifamiliar a 10 km de la ciudad y muy próxima al Polígono. Distribuída en 2 plantas más garaje para 2 coches. Planta primera: 1 dormitorio, salón, amplia cocina con acceso a balcón. Planta segunda: 4 dormitorios y 1 baño. Posibilidad de hacer 2 viviendas independientes. Cuenta con una finca de 200 m2 muy cercana.

Suelos de parquet, ventanas de climalit, calefacción de gasoil.'}

{'es-ES': 'VENTA PISO A ESTRENAR PUENTE MILENIO

Pisos a estrenar, situado en el puente del milenio, se distribuye en 3 habitaciones, salón, cocina (sin amueblar), 2 baños, garaje y bodega. Armarios empotrados.

Calefacción y agua caliente gasoil individual.'}

{'es-ES': 'Materiales de primera calidad. Pozo de barrena de 70 metros, jardín con riego automático por aspersión, finca de 700 metros totalmente cerrada en piedra y alambrada, cenador exterior con barbacoa, cocina y aseo, piscina y patio.

distribución:
terraza descubierta de 80 m2.'}

{'es-ES': 'Piso en Venta en la Plaza del Couto en Ourense ciudad. Justo al lado de la Avenida Portugal y muy cerca del Parque Barbaña. Con todos los servicios.

El inmueble cuenta con 115m². Estos se distribuyen en: salón, cocina independiente, 4 habitaciones y 1 baño. Se encuentra listo para vivir en él. Su cocina se encuentra totalmente amueblada y equipada con electrodomésticos (vitro, horno, nevera, etc). Es totalmente exterior y muy luminoso. Además, se encuentra en un edificio con ascensor. Incluye un trastero amplio.

La plaza de garaje es opcional, con un precio de 18.000€ a mayores.'}

{'es-ES': 'Precioso apartamento totalmente reformado a estrenar situado en la Rúa da Inmaculada, en Ourense ciudad próxima a la zona de la Residencia. Zona con todos los servicios, se encuentra justo al lado del CEIP Inmaculada.

El inmueble consta de 60m2. Cuenca con: salón con cocina americana, dos dormitorios y un baño. Se encuentra totalmente amueblado, con muebles y electrodomésticos modernos, de alta calidad sin estrenar. La cocina cuenta con todos los electrodomésticos (vitro, nevera, lavadora, secadora, etc). En ambas habitaciones hay armarios empotrados y televisión, además la habitación principal tiene instalación de iluminación led en el cabecero de la cama. El suelo es de tarima flotante en salón y dormitorios, y de cerámica en baño y cocina. Las ventanas son oscilobatientes.

El coste de la comunidad es de 15€/mes.'}

{'es-ES': 'VENTA PISO COUTO

Piso totalmente exterior, 3 habitaciones, salón, cocina amueblada con comedor, 2 baños, garaje, trastero y bodega.

Muy luminoso. Balcón.'}

{'es-ES': 'Precioso piso para reformar en el Casco Viejo de Ourense Ciudad. Muy bien ubicado entre la Plaza Mayor y el Jardín del Posío.

El piso consta de 120m2 con grandes posibilidades de reforma. Es un piso corrido, con balcones a la Plaza de la Herrería y galería con vistas al Centro de Interpretación de las Burgas y piscina Termal. Tiene techos altos y cuenta con buena distribución. Cuenta con bodega en planta sótano y tiene jardín privado comunitario. Es un primero sin ascensor. 

(Presupuesto efectuado para reforma de la vivienda por empresa especializada de 30.000€).'}

{'es-ES': 'Edificio a reformar o construír, 4 plantas edificables, bajo reformado integralmente hace 4 años.

Terreno trasero.

Más detalles por privado'}

{'es-ES': 'APARTAMENTO CON GRAN TERRAZA EN EL POSÍO!! Distribuido en 2 dormitorios, salón, salita, cocina independiente y cuarto de baño reformado con plato de ducha.

Calefacción y agua caliente de gas natural. Edificio con ascensor y video-portero.

Para más información visite nuestra oficina en C/ Valle Inclán nº3, galerías Santo Domingo o llámenos al 988 241 993.'}

{'es-ES': 'Preciosa casa de piedra rehabilitada muy cerca de Santa Mariña de aguas Santas, concello de Allariz. Muy cerca pasa el Camino de Santiago Vía de la Plata. Zona muy tranquila y familiar.

La casa cuenta con 127m² en una parcela de 2º0m² totalmente cerrada. La vivienda se divide en dos plantas. La planta baja (62m²) totalmente diáfana. En la planta alta encontramos el salón-comedor, cocina independiente, 2 dormitorios, 1 baño y una amplia terraza. La cocina se encuentra totalmente equipada y amueblada. En cuanto a su agua caliente es de termo eléctrico. La casa fue rehabilitada en 2013 y se reformaron: ventanas, tejado, fontanería y electricidad. 

Cuenta con un pajar en buen estado, hórreo y pozo delante de la casa.'}

{'es-ES': 'Piso reformado en la calle Curros Enriquez, de tres habitaciones y dos baños, salón comedor y cocina. Luminoso.  Con garaje (2 plazas ) y trastero.
Ascensor cota cero rampa nueva. Agua caliente y calefacción central con contador individual.


'}

{'es-ES': 'VENTA PISO ZONA VEINITIUNO

Piso exterior 3 habitaciones, salón, cocina amueblada, 1 baño, 1 aseo,  2º sin ascensor, amplio trastero.

 Exterior. Balcón'}

{'es-ES': 'Apartamento totalmente reformado en Vasco da Ponte, en la zona de Lagunas de Ourense ciudad. Muy cerca del centro de la ciudad y del Campus universitario. Zona con todos los servicios.

El apartamento cuenta con 69m². Estos se distribuyen en: salón con cocina integrada, zona de lavandería, 2 habitaiciones y 1 baño. Se encuentra totalmente reformado con muy buenas calidades.Cocina de diseño totalmente amueblada y equipada. Su dormitorio principal cuenta con vestidor. Es totalmente exterior, siendo muy luminoso. En cuanto a su calefacción y agua caliente son de gas ciudad con contador individual. Incluye amplio trastero de 17m².

Su precio de venta es de 129.000€. Además se contempla opción de alquiler con opción a compra. El precio de la comunidad es de 20€.'}

{'es-ES': 'Precioso chalet en venta en Figueiras Amoeiro, muy cerca de Ourense ciudad. A 12 minutos de Ourense ciudad.

La casa cuenta con 211m². En ella encontramos: amplio salón-comedor con chimenea, cocina independiente totalmente equipada, 4 habitaciones y 2 baños. Además cuenta con bodega y garaje. Tiene un precioso porche muy amplio. En cuanto a su calefacción es de acumulador eléctrico y el agua caliente es de termo eléctrico. No necesita reforma.

Se encuentra en una parcela totalmente cerrada de 3.000m². Cuenta con un jardín perfectamente cuidado con una estupenda piscina. La parcela tiene dos entradas: la principal que da a la casa directamente y otra que da a los galpones y cuadra. Cuenta con 4 galpones y una cuadra de caballos. Tiene agua de la traída, desagüe y 2 pozos.'}

{'es-ES': 'Casa rústica en venta en Bóveda, concello de Amoeiro. A menos de 15 minutos de Ourense centro. Zona tranquila y familiar.

La vivienda es totalmente de piedra y cuenta con 272m². Estos se distribuyen en  salón, cocina independiente, 4 habitaciones, 1 baño y gran balconada. Cuenta con 3 entradas independientes y 2 pozos, así como un amplio patio. Ideal para reformar y dejar a tu gusto. 


Más pisos y casas en nuestra página web inmobiliarianovoaramos.com. Síguenos en Instagram y Facebook. Podrás encontrarnos en Rua Bedoya, nº1, Entresuelo, Ourense ciudad.'}

{'es-ES': 'VENTA PISO VALENZANA

VALENZA, PISO exterior distribuido en  3 habitaciones, salón, cocina amueblad, 2 baños, plaza de garaje en el mismo edificio y trastero. 2 balcones.Calefacción

Para más información visite nuestra oficina en C/ Valle Inclán nº3, galerías Santo Domingo o llámenos al 988 241 993.'}

{'es-ES': 'VENTA PISO AVENIDA MADRID

Se vende amplio piso (110 Metros útiles) situado en la zona centro de Xinzo de Limia, totalmente exterior, se distribuye en hall de entrada, 4 habitaciones, salón con balcón, cocina amueblada con electrodomésticos con acceso a galería, 2 baños completos, plaza de garaje abierta situada en el mismo edficio, bodega al lado del garaje y trastero en planta bajo cubierta. Portal con accesibilidad. Calefacción y agua caliente de Gas Natural.

Doble ventana.'}

{'es-ES': 'CENTRO

Ultima vivienda!! A estrenar

3 habitaciones (armarios empotrados), salón, cocina, 2 baños, garaje y bodega.'}

{'es-ES': 'OBRA NUEVA VALENZANA

Pisos  en construcción, exteriores,  3 Dormitorios  con armarios empotrados,  Salón,  Cocina,  2 Baños. Ascensor, Plaza de Garaje  y Trastero. 

Excelentes calidades.  Vistas'}

{'es-ES': 'Piso completamente reformado con excelentes calidades en el Puente, frente a la estación. La vivienda de 126m² útiles se encuentra distribuida en un amplio recibidor, salón con balcón a la fachada, cocina independiente con una pequeña galería habilitada como zona de lavandería, 3 dormitorios (uno de ellos con un aseo) y 1 cuarto de baño completo. Cuenta además con una bodega de 12m². 

La vivienda se encuentra emplazada en un edificio icónico de la ciudad que se ha mantenido perfectamente conservado por sus copropietarios (tejado, bajantes, ascensor y portal reformado).

